import React from "react";
import Project from "./Project";
const Portfolio = () => {
  return (
    <section className="portfolio-section">
      <h2 className="section-title"> Portfolio </h2>
      <div className="projects-container">
        <Project className="project-one">
          <a href="https://joshua-watson96.github.io/Travel-Wise/">
            <img src="../assets/TravelWise.png" alt="travel wise app" />
            <p> Travel Wise (Travel Website) </p>
          </a>
        </Project>
        <Project className="project-two">
          <a href="https://betterreads-bookreviewapp.herokuapp.com/login">
            <img src="./assets/thumbnail_2.png" alt="diabetes tracking app" />
            <p> Better Read (Book Review App) </p>
          </a>
        </Project>
      </div>
    </section>
  );
};

export default Portfolio;
